// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awCommandListRenderFunction } from 'js/AwPopupCommandListService';


/*
ctx imports
*/
import { getCommandStates as commandDisplays } from 'js/command.service';
const ctxImportObj = { commandDisplays };


/*
dynamic import
 */
registerDynImportEntry('js/AwPopupCommandListService', () => import('js/AwPopupCommandListService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awCommandListRenderFunction",
            "deps": "js/AwPopupCommandListService"
        }
    },
    "ctx": {
        "commandDisplays": {
            "parser": {
                "method": "getCommandStates",
                "deps": "js/command.service"
            }
        }
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "i18n": {
        "NO_COMMANDS_TEXT": [
            "BaseMessages"
        ]
    },
    "_viewModelId": "AwPopupCommandList",
    "_uniqueViewModelId": "AwPopupCommandList"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awCommandListRenderFunction, undefined, ctxImportObj );

export default Component;
